import React from 'react';
import { Container, Col, Row, Table } from 'reactstrap'

export default function SetSearch(props) {
    return (
        <Container>
            <Table hover>
                <thead>
                    <tr>
                        <th>Set</th>
                    </tr>
                </thead>
                <tbody>


                    {props.setSearchState.allSets.map(set => <tr><th>{set.name}</th></tr>)}

                </tbody>
            </Table>
            <Row>



            </Row>
        </Container>
    )
}
